import { Route, Routes } from 'react-router-dom';
import Download_page from './Downloadpage';
import logo from './logo.svg';

function Navigation() {
    return (
        <nav className="wrapper-top">
            <Routes>
                <Route path="/" exact element={<app />} />
                <Route path='/downloadpage' exact element={<Download_page />} />
            </Routes>
                <ul className='nav-list'>
                    <a href="/" >
                        <button className='button-logo' >
                            <img src={logo} alt='AidALL'></img>
                        </button>
                    </a>
                    <button>
                    <ul className="nav-right">
                        <li className="nav-menu"><a href="#contact">Contact</a></li>
                        <li className="nav-menu"><a href="downloadpage">다운로드</a></li>
                        <li className="nav-menu"><a href="#services">서비스</a></li>
                        <li className="nav-menu"><a href="#vision">비전</a></li>
                        <li className="nav-menu"><a href="#about">소개</a></li>
                    </ul>
                    </button>
                </ul>

        </nav>
    );
}

export default Navigation;
